== 简介 ==
离时社是一个新兴的[[Vocaloid]]及[[UTAU]]中文创作团队，创立于2018年08月14日。目前共有43位成员，{{黑幕|现在正在绝赞招人中}}，使用过[[洛天依]]、[[言和]]、[[乐正绫]]等歌姬。

前身为隶属于第五附属中学的音乐部，后因要求脱离第五音{{黑幕|妄想}}，升级为离时社。

目前播放和收藏最多的作品都是《[[伴我同行]]》，截至现在已有{{BilibiliCount|id=35920558}}次观看，{{BilibiliCount|id=35920558|type=4}}人收藏。

== 经历 ==
*2018.02.12　音乐部创立。
*2018.06.05　在b站首投中文vocaloid[[洛天依]]、[[言和]]、[[乐正绫]]原创曲《[[冒险adventure]]》。
*2018.08.08　投稿部内[[洛天依]]、[[乐正绫]]原创曲《[[拯救deliver]]》。
*2018.08.14　升级为离时社。
*2018.09.24　投稿社内[[洛天依]]、[[乐正绫]]原创曲《[[氢与氧的恋歌]]》。
*2018.11.14　与妄想症原班人马合作[[洛天依]]原创曲《[[伴我同行]]》。
*2018.11.14　投稿社内[[洛天依]]原创曲《[[残蝶]]》。
*2018.12.24　投稿由'''落叶'''策划的[[洛天依]]原创曲《[[黎明(洛天依)|黎明]]》
*2019.01.01　投稿社内[[洛天依]]原创曲《[[长夜难待]]》。
*2019.01.08  投稿社内[[莲华]]原创曲《[[未途]]》
